import React from 'react';
import { Outlet, Link } from 'react-router-dom';

function Nav() {
  return (
    <div>
      <Link to='/bookkeep/record'>record</Link>
      <span> </span>
      <Link to='/bookkeep/present'>analitic</Link>
      <Outlet></Outlet>
    </div>
  );
}

export default Nav;
